@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
}
<h1>Star Wars</h1>
<p>Welcome to all information about star wars movie!</p>
<ul>
  <li>All the Star Wars data you've ever wanted</li>
  <li>Planets, Spaceships, Vehicles, People, Films and Species</li>
  <li>From all SEVEN Star Wars films</li>
</ul>
<p>Now with The Force Awakens data!</p>
